INSERT INTO `ps_cms_lang` VALUES (1,1,1,'Livraison','Nos conditions de livraison','conditions, livraison, dlais, expdition, colis','<h2>Expditions et retours</h2><h3>Expdition de votre colis</h3><p>Les colis sont gnralement expdis dans un dlai de 2jours aprs rception du paiement. Ils sont expdis via UPS avec un numro de suivi et remis sans signature. Les colis peuvent galement tre expdis via UPS Extra et remis contre signature. Veuillez nous contacter avant de choisir ce mode de livraison, car il induit des frais supplmentaires. Quel que soit le mode de livraison choisi, nous vous envoyons un lien pour suivre votre colis en ligne.</p><p>Les frais d\'expdition incluent les frais de prparation et d\'emballage ainsi que les frais de port. Les frais de prparation sont fixes, tandis que les frais de transport varient selon le poids total du colis. Nous vous recommandons de regrouper tous vos articles dans une seule commande. Nous ne pouvons regrouper deux commandes places sparment et des frais d\'expdition s\'appliquent  chacune d\'entre elles. Votre colis est expdi  vos propres risques, mais une attention particulire est porte aux objets fragiles.<br /><br />Les dimensions des botes sont appropries et vos articles sont correctement protgs.</p>','livraison'),(1,2,1,'Livraison','Nos conditions de livraison','conditions, livraison, dlais, expdition, colis','<h2>Expditions et retours</h2><h3>Expdition de votre colis</h3><p>Les colis sont gnralement expdis dans un dlai de 2jours aprs rception du paiement. Ils sont expdis via UPS avec un numro de suivi et remis sans signature. Les colis peuvent galement tre expdis via UPS Extra et remis contre signature. Veuillez nous contacter avant de choisir ce mode de livraison, car il induit des frais supplmentaires. Quel que soit le mode de livraison choisi, nous vous envoyons un lien pour suivre votre colis en ligne.</p><p>Les frais d\'expdition incluent les frais de prparation et d\'emballage ainsi que les frais de port. Les frais de 